"""ID: alexlu.1LANG: PYTHON3TASK: dualpal"""with open("dualpal.in", "r") as f:    n, s = [int(x) for x in f.readline().strip().split()]def check_palindrome(num):    return True if str(num) == str(num)[::-1] else Falsedef convert_base(num, base):    n = num    res = []    while n != 0:        res.append((chr(n % base - 10 + ord("A"))) if n % base > 9 else str(n % base))        n = n // base    return "".join(res[::-1])res = []x = s + 1while len(res) < n:  count = 0  for j in range(2, 11):      if check_palindrome(convert_base(x, j)):          count += 1  if count >= 2:      res.append(x)  print(x, j, res)  x += 1with open("dualpal.out", "w") as f:    for x in range(len(res)):        f.write(f"{res[x]}\n")